import { MultiSelect } from "react-multi-select-component";

const SelectionMenu = () => {
    const options = [
        { value: 'wildfire', value: 'WildFires' },
        { value: 'volcano', value: 'Volcanoes' },
      ];
    return (
        <div className="selection-menu">
            <MultiSelect options={options} />
        </div>
    )
}

export default SelectionMenu;
